import React from 'react';
import './Projects.css';

const Projects = () => {
  const projects = [
    {
      title: 'Multimodel Swine Flu Detector',
      description:
        'ML-based prediction system using 5 algorithms (SVM, NB, Decision Tree, KNN, Random Forest) achieving 95% accuracy. Deployed on Google Cloud Platform.',
      tech: ['Python', 'Machine Learning', 'GCP'],
      github: 'https://github.com/SreeCharanManne/Swineflu_pediction_using_ML_GCP',
    },
    {
      title: 'Dining Management System',
      description:
        'University dining management application with attendance-based fee calculation and real-time data sync using Firebase.',
      tech: ['JavaScript', 'Firebase', 'Bootstrap'],
      github: 'https://github.com/SreeCharanManne/SoftwareProject.git',
    },
    {
      title: 'NewsApp with Covid-19 Tracker',
      description:
        'Real-time news aggregation and Covid-19 tracking application with responsive design, deployed on Heroku.',
      tech: ['React.js', 'API Integration', 'Heroku'],
      github: 'https://github.com/SreeCharanManne/Covid-19-Tracker',
    },
  ];

  return (
    <section id="projects" className="section projects">
      <p className="section-label">Projects</p>
      <h2 className="section-title">Things I've built</h2>

      <div className="projects__grid">
        {projects.map((project, i) => (
          <div key={i} className="projects__card">
            <div className="projects__card-top">
              <h3 className="projects__name">{project.title}</h3>
              <p className="projects__desc">{project.description}</p>
            </div>
            <div className="projects__card-bottom">
              <div className="projects__tech">
                {project.tech.map((t) => (
                  <span key={t} className="projects__tech-tag">
                    {t}
                  </span>
                ))}
              </div>
              <a
                href={project.github}
                target="_blank"
                rel="noopener noreferrer"
                className="projects__link"
                aria-label={`View ${project.title} on GitHub`}
              >
                <i className="fab fa-github" />
              </a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
